                break;
            }
            if (x.digits[i] < y.digits[i]) {
                z = x;
                x = y;
                y = z; // swap x y
                break;
            }
        }
    }

    z = new BigInt(x.len, (z == 0) ? 1 : 0);
    zds = z.digits;

    for (i = 0, num = 0; i < y.len; i++) {
        num += x.digits[i] - y.digits[i];
        zds[i] = (num & 0xffff);
        num >>>= 16;
    }
    while (num && i < x.len) {
        num += x.digits[i];
        zds[i++] = (num & 0xffff);
        num >>>= 16;
    }
    while (i < x.len) {
        zds[i] = x.digits[i];
        i++;
    }

    return bigint_norm(z);
}

function bigint_plus(x, y) {
    x = bigint_from_any(x);
    y = bigint_from_any(y);
    return bigint_add_internal(x, y, 1);
}

function bigint_minus(x, y) {
    x = bigint_from_any(x);
    y = bigint_from_any(y);
    return bigint_add_internal(x, y, 0);
}

function bigint_mul(x, y) {
    var i, j;
    var n = 0;
    var z;
    var zds, xds, yds;
    var dd, ee;
    var ylen;

    x = bigint_from_any(x);
    y = bigint_from_any(y);

    j = x.len + y.len + 1;
    z = new BigInt(j, x.sign == y.sign);

    xds = x.digits;
    yds = y.digits;
    zds = z.digits;
    ylen = y.len;
    while (j--) zds[j] = 0;
    for (i = 0; i < x.len; i++) {
        dd = xds[i];
        if (dd == 0) continue;
        n = 0;
        for (j = 0; j < ylen; j++) {
            ee = n + dd * yds[j];
            n = zds[i + j] + ee;
            if (ee) zds[i + j] = (n & 0xffff);
            n >>>= 16;
        }
        if (n) {
            zds[i + j] = n;
        }
    }

    return bigint_norm(z);
}

function bigint_divmod(x, y, modulo) {
    var nx = x.len;
    var ny = y.len;
    var i, j;
    var yy, z;
    var xds, yds, zds, tds;
    var t2;
    var num;
    var dd, q;
    var ee;
    var mod, div;

    yds = y.digits;
    if (ny == 0 && yds[0] == 0) return null; // Division by zero
    if (nx < ny || nx == ny && x.digits[nx - 1] < y.digits[ny - 1]) {
        if (modulo) return bigint_norm(x);
        return BigInt(1, 1);
    }

    xds = x.digits;
    if (ny == 1) {
        dd = yds[0];
        z = x.clone();
        zds = z.digits;
        t2 = 0;
        i = nx;
        while (i--) {
            t2 = t2 * 65536 + zds[i];
            zds[i] = (t2 / dd) & 0xffff;
            t2 %= dd;
        }
        z.sign = (x.sign == y.sign);
        if (modulo) {
            if (!x.sign) t2 = -t2;
            if (x.sign != y.sign) {
                t2 = t2 + yds[0] * (y.sign ? 1 : -1);
            }
            return bigint_from_int(t2);
        }
        return bigint_norm(z);
    }

    z = new BigInt(nx == ny ? nx + 2 : nx + 1, x.sign == y.sign);
    zds = z.digits;
    if (nx == ny) zds[nx + 1] = 0;
    while (!yds[ny - 1]) ny--;
    if ((dd = ((65536 / (yds[ny - 1] + 1)) & 0xffff)) != 1) {
        yy = y.clone();
        tds = yy.digits;
        j = 0;
        num = 0;
        while (j < ny) {
            num += yds[j] * dd;
            tds[j++] = num & 0xffff;
            num >>= 16;
        }
        yds = tds;
        j = 0;
        num = 0;
        while (j < nx) {
            num += xds[j] * dd;
            zds[j++] = num & 0xffff;
            num >>= 16;
        }
        zds[j] = num & 0xffff;
    } else {
        zds[nx] = 0;
        j = nx;
        while (j--) zds[j] = xds[j];
    }
    j = nx == ny ? nx + 1 : nx;
    do {
        if (zds[j] == yds[ny - 1]) q = 65535;
        else q = ((zds[j] * 65536 + zds[j - 1]) / yds[ny - 1]) & 0xffff;
        if (q) {
            i = 0;
            num = 0;
            t2 = 0;
            do { // multiply and subtract
                t2 += yds[i] * q;
                ee = num - (t2 & 0xffff);
                num = zds[j - ny + i] + ee;
                if (ee) zds[j - ny + i] = num & 0xffff;
                num >>= 16;
                t2 >>>= 16;
            } while (++ i < ny );
            num += zds[j - ny + i] - t2; // borrow from high digit; don''t update
            while (num) { // "add back" required
                i = 0;
                num = 0;
                q--;
                do {
                    ee = num + yds[i];
                    num = zds[j - ny + i] + ee;
                    if (ee) zds[j - ny + i] = num & 0xffff;
                    num >>= 16;
                } while (++ i < ny );
                num--;
            }
        }
        zds[j] = q;
    } while (-- j >= ny );

    if (modulo) { // just normalize remainder
        mod = z.clone();
        if (dd) {
            zds = mod.digits;
            t2 = 0;
            i = ny;
            while (i--) {
                t2 = (t2 * 65536) + zds[i];
                zds[i] = (t2 / dd) & 0xffff;
                t2 %= dd;
            }
        }
        mod.len = ny;
        mod.sign = x.sign;
        if (x.sign != y.sign) {
            return bigint_add_internal(mod, y, 1);
        }
        return bigint_norm(mod);
    }

    div = z.clone();
    zds = div.digits;
    j = (nx == ny ? nx + 2 : nx + 1) - ny;
    for (i = 0; i < j; i++) zds[i] = zds[i + ny];
    div.len = i;
    return bigint_norm(div);
}

function bigint_div(x, y) {
    x = bigint_from_any(x);
    y = bigint_from_any(y);
    return bigint_divmod(x, y, 0);
}

function bigint_mod(x, y) {
    x = bigint_from_any(x);
    y = bigint_from_any(y);
    return bigint_divmod(x, y, 1);
}

function bigint_cmp(x, y) {
    var xlen;

    if (x == y) return 0; // Same object
    x = bigint_from_any(x);
    y = bigint_from_any(y);
    xlen = x.len;

    if (x.sign != y.sign) {
        if (x.sign) return 1;
        return - 1;
    }

    if (xlen < y.len) return (x.sign) ? -1 : 1;
    if (xlen > y.len) return (x.sign) ? 1 : -1;

    while (xlen--&&(x.digits[xlen] == y.digits[xlen]));
    if ( - 1 == xlen) return 0;
    return (x.digits[xlen] > y.digits[xlen]) ? (x.sign ? 1 : -1) : (x.sign ? -1 : 1);
}

function bigint_number(x) {
    var d = 0.0;
    var i = x.len;
    var ds = x.digits;

    while (i--) {
        d = ds[i] + 65536.0 * d;
    }
    if (!x.sign) d = -d;
    return d;
}');

